import React from "react";
import Button from "./Button";

const Buttons = ({ content }) => {
    const groupButtons = content.map(el => {
        return <Button name = {el.name}  />
      });
    return <div className="groupButtons" >
        {groupButtons}
        </div>
};

export default Buttons;
